def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0

    # New variables to handle whitespace
    wait_for_whitespace = False
    whitespace_count = 0

    for char in prefix:
        if wait_for_whitespace:
            if char == '\t':
                whitespace_count += 4
            elif char == ' ':
                whitespace_count += 1
            else:
                wait_for_whitespace = False
                whitespace_count = 0
        else:
            if char == ' ':
                current_column += 1
                whitespace_count += 1
            elif char == '\t':
                current_column += 4
                whitespace_count += 4
            else:
                wait_for_whitespace = True
                whitespace_count = 0

        current_line += char

        if whitespace_count != 0 and current_column <= column:
            if char == '\n':
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]
                lines.append(current_line)
                current_line = ""
                current_column = 0
                whitespace_count = 0

    return ''.join(lines), current_line
